const Main = () => {
    let heading ='Order Summary';
    let text = 'You can now listen to millions of songs, audiobooks and podcasts on any device anywhere you like!';


  return (
    <div className='main'>
        Main
    <h1> {heading} </h1>
    <p> {text} </p>
    <div>
        <img/>
    </div>
    </div>
  )
}

export default Main
